import Vue from 'vue'
import VueRouter from 'vue-router'
import HomeView from '../views/HomeView.vue'
import MessageView from '../views/MessageView.vue'

Vue.use(VueRouter)

const routes = [
  {
    path: '/home',
    name: 'home',
    component: HomeView
  },
  {
    path: '/message',
    name: 'message',
    component:MessageView
  },
  {
    path: '/',
    redirect: '/home',
  }
]

const router = new VueRouter({
  routes
})

export default router
